import React from "react"
import ImageGalleryItem from "components/ImageGalleryItem"

const ImageGallery = ({ images, onImagesClick }) => {
    console.log(image);
    return (<ul className="gallery">
        {image.map(image => {
            return (
                <ImageGalleryItem
                    key={image.id}
                    image={image}
                    onImageClick={onImagesClick} />
            )
        })}
</ul>)
}

export default ImageGallery
